var app=angular.module("personalProject").controller("loginCtrl",["$scope","$http","loginService",function(o,t,l){o.login=function(o){return t({method:"POST",url:"http://localhost:8081/auth/local",data:{email:o.email,password:o.password}}).then(function(o){console.log(o)})},o.register=function(l){return t({method:"POST",url:"http://localhost:8081/register/user",data:{email:l.email,password:l.password}}).then(function(t,l){o.displayName=t.data.email,console.log(t)})}}]);